import { NavLink } from "react-router-dom";

const MainNavigation = () => {
  return (
    <header>
      <ul>
        <li>
          <NavLink to='/quotes'>All Quotes</NavLink>
        </li>
        <li>
          <NavLink to='/new-quote'>New Quote</NavLink>
        </li>
      </ul>
    </header>
  );
};

export default MainNavigation;
